<span class="line"><span>type ::= ( &quot;void&quot; [ &quot;*&quot; ]* ) | ( [ &quot;dynamic&quot; ] [ &quot;unowned&quot; ] symbol [ type_arguments ] [ &quot;*&quot; ]* [ &quot;?&quot; ] array_type* )</span></span>
